script: |
  super -f text -I q10115.spq | sort > q10115.out

inputs:
  - name: q10115.spq
    data: |
      SELECT ALL + col1, + 98 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NOT + - 54 * - + col0 BETWEEN - 64 AND col1 );
  - name: tab2

outputs:
  - name: q10115.out
    data: |
      51	98
      67	98
      77	98
